import { useNavigate } from "react-router-dom";
import { useDispatch } from 'react-redux';
import { dir } from "../store/directionSlice";

const MainPage = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const move = () => {
    navigate('/word');
    dispatch(dir('right'));
  };

  return (
      <div className="main-container">
        <div className="today-word" id="today-word">
          <div>
            <div className="group" id="4:412">
              <div className="inner-group" id="4:408">
                <div className="search" id="4:436">
                  검색하기
                </div>
                {/* <img class="icon" src="/api/try-prod-ap-southeast-1-first-cluster/project..." id="4:407" /> */}
              </div>
            </div>
            {/* 원래 피그마에서의 버튼이 노출되어있지 않아서 임의로 이 부분에 추가했습니다. */}
            <div className="today-word" id="15:112" onClick={()=>move()}>
              오늘의 단어
            </div>
            <div className="today-word-image" id="today-word-image">
              <div className="overlay"></div>
              <div className="rectangle" id="15:109"></div>
              <div className="question-container" id="15:110">
                <span className="word-category">테이크 아웃 </span>
                {/* <!--단어 카테고리인 테이크아웃 부분은 변수로 써야할듯--> */}
                <span className="word-meaning">이 무슨 말인지</span>
              </div>
            </div>
            <div className="button-group" id="button-group">
              <div className="know" id="know">
                알아요
              </div>
              <div className="dont-know" id="dont-know" >
                몰라요
              </div>
            </div>
          </div>
        </div>
      </div>
  );
};

export default MainPage;
